import styled from 'styled-components';

const SignupForm = styled("div")`
    display: flex;
    justify-content: space-around;
    align-items: center;
    flex-direction: column;
    h3 {
        order: -1;
    }
    .userInfo {
        margin-bottom: 20px;
        width: 50%;
    }
`;

export default SignupForm;
